import React from 'react';
import '../styles/Hero.css';

const Hero = () => {
  return (
    <section className='hero'>
      <div>
        <h1>Roman Chavez</h1>
        <p>Welcome to my portfolio</p>
      </div>
      <div>
        <img src="https://via.placeholder.com/150" alt="Roman Chavez" />
      </div>
    </section>
  );
};

export default Hero;
